import ReactDOM from 'react-dom';
import './index.css';

const BookList = () =>{
    return(
    <section className='booklist'>
        <Book />
        <Book></Book>
        <Book></Book>
    </section>
    );
    }

    const Title = "A man called ove";
    const Author = "Fredrick Batman";

    const Book =()=>{
    return(
    <article className='book'>
        <img src="https://www.amazon.com/sljsakoxvfjav" alt="not found" />
        <h1>{Title}</h1>
        <h3><i>{Author}</i></h3>
    </article>
    );
    }


    const Image =()=>{
    return <img src="https://m.media-amazon.com/images/I/81DXIOk9glL._AC._SR360,460.jpg" alt='book' style={{width:'200px', height : '200px'}} />
    }



ReactDOM.render(<BookList></BookList>,document.getElementById('root'));
